<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Do While</title>
</head>
<body>
    <script>
        let ind;
        ind = 9;
        do{
            document.write(ind+ "<br>")
            ind=ind+1;
        }
        while(ind<=20);
    </script>
</body>
</html>
